function generateBoard(){
  let output = {startX: 1, startY: 0, cells: []}
  for (let x = 0; x<cols; x++){
    output.cells.push([])
    for (let y = 0; y<rows; y++){
      let type = (x<6 || y<6 || x > cols-7 || y > rows-7) ? "water" : "random"
      output.cells[x].push({tile: type, type: type, revealed: false})
    }
  }
  board = output
}

